            const loader = new THREE.GLTFLoader();
            loader.load(glbData, function(gltf) {
                const model = gltf.scene;
                scene.add(model);
                model.position.set(0, -1, 0); // Adjust position

                // Store object names for tooltip interaction
                model.traverse((child) => {
                    if (child.isMesh && elementNames[child.name]) {
                        child.userData.tooltip = "Elementas " + elementNames[child.name];
                    }
                });
            }, undefined, function(error) {
                console.error("Error loading GLB file:", error);
            });

            // Camera controls
            const controls = new THREE.OrbitControls(camera, renderer.domElement);
            controls.enableDamping = true;
            controls.dampingFactor = 0.05;
            controls.screenSpacePanning = false;
            controls.minDistance = 1;
            controls.maxDistance = 50;
            controls.maxPolarAngle = Math.PI / 2;

            camera.position.set(0, 2, 5);
            controls.update();

            function animate() {
                requestAnimationFrame(animate);
                controls.update();
                renderer.render(scene, camera);
            }

            animate();

            // Resize handling
            window.addEventListener("resize", function() {
                camera.aspect = window.innerWidth / window.innerHeight;
                camera.updateProjectionMatrix();
                renderer.setSize(window.innerWidth, window.innerHeight);
            });

            // Raycasting for tooltips
            const raycaster = new THREE.Raycaster();
            const mouse = new THREE.Vector2();

            function onMouseMove(event) {
                mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
                mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

                raycaster.setFromCamera(mouse, camera);
                const intersects = raycaster.intersectObjects(scene.children, true);

                if (intersects.length > 0) {
                    const firstIntersect = intersects[0].object;
                    if (firstIntersect.userData.tooltip) {
                        tooltip.style.display = "block";
                        tooltip.style.left = event.clientX + 10 + "px";
                        tooltip.style.top = event.clientY + 10 + "px";
                        tooltip.innerText = firstIntersect.userData.tooltip;
                    } else {
                        tooltip.style.display = "none";
                    }
                } else {
                    tooltip.style.display = "none";
                }
            }

            window.addEventListener("mousemove", onMouseMove);
        });
    </script>
